<p>Feign 和 OpenFeign 的区别</p>
<blockquote>
<p>Feign 和 OpenFeign是两个技术，都是作为服务调用存在的，OpenFeign 是SpringCloud在Feign的基础上进行封装得到的，支持SpringMvc的注解</p>
